package jahnavi;

public class switchstatement {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int age = 19;
switch (age)
{
case (12):
	
	System.out.println("ur under 19");
break;
case (18) :
	System.out.println("eligible for marriage");
break;
case (19) :
	System.out.println("completion of teen");
break;

case (25) :
	System.out.println("over 19");
default :
	System.out.println("invalid");


	
}
	}

}


